import { useState } from 'react';
import './App.css';

function Button({text, handle}) {
  return (
    <button onClick={handle}>{text}</button>
  );
}

function NavBar() {
  return (
    <div className='divBar'>

    </div>
  );
}

function App() {
  const list = {"둘러보기":{"text":"둘러보기", "handle":()=>{}}}
  return (
    <div className="App">
      <header className="App-header">
        <Button text={list["둘러보기"]["text"]} handle={list["둘러보기"]["handle"]}></Button>
      </header>
    </div>
  );
}

export default App;
